import React from 'react'
import Connexion from '../Compenent/Inscriptions-Connexions/Connexion'
import {useSelector} from 'react-redux'
import Router from 'next/router'
import CustomProvider  from '../CustomProvider'
import {connected} from '../Reducer/connexionReducer'
export default function Index() {
    if(!connected)
    return (

        <CustomProvider>
            <Connexion/>
        </CustomProvider>

    )


}
